DROP TABLE IF EXISTS "oc_known_users";
DROP SEQUENCE IF EXISTS oc_known_users_id_seq;
CREATE SEQUENCE oc_known_users_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1;

CREATE TABLE "public"."oc_known_users" (
    "id" bigint DEFAULT nextval('oc_known_users_id_seq') NOT NULL,
    "known_to" character varying(255) NOT NULL,
    "known_user" character varying(255) NOT NULL,
    CONSTRAINT "oc_known_users_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

CREATE INDEX "ku_known_to" ON "public"."oc_known_users" USING btree ("known_to");

CREATE INDEX "ku_known_user" ON "public"."oc_known_users" USING btree ("known_user");


DROP TABLE IF EXISTS "oc_login_flow_v2";
DROP SEQUENCE IF EXISTS oc_login_flow_v2_id_seq;
CREATE SEQUENCE oc_login_flow_v2_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1;

CREATE TABLE "public"."oc_login_flow_v2" (
    "id" bigint DEFAULT nextval('oc_login_flow_v2_id_seq') NOT NULL,
    "timestamp" bigint NOT NULL,
    "started" smallint DEFAULT '0' NOT NULL,
    "poll_token" character varying(255) NOT NULL,
    "login_token" character varying(255) NOT NULL,
    "public_key" text NOT NULL,
    "private_key" text NOT NULL,
    "client_name" character varying(255) NOT NULL,
    "login_name" character varying(255),
    "server" character varying(255),
    "app_password" character varying(1024),
    CONSTRAINT "login_token" UNIQUE ("login_token"),
    CONSTRAINT "oc_login_flow_v2_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "poll_token" UNIQUE ("poll_token")
) WITH (oids = false);

CREATE INDEX "timestamp" ON "public"."oc_login_flow_v2" USING btree ("timestamp");


